export default function PurpleContent() {
  return (
    <div className="   bg-purple  ">
      <div className="grid grid-cols-3">
        <div className="grid grid-cols-2"></div>
        <div className="grid grid-cols-2"></div>
        <div className="grid grid-cols-2"></div>
      </div>
    </div>
  );
}
